import React from 'react';
import JsonList from './jsonList';
import ListItems from './list_items'
import './navigation.css'


class Navigation extends React.Component{
  render(){
    return(
      <nav id="mynavbar" className="navbar navbar-expand-xl navbar-dark">
      <a class="navbar-brand col-2" href="home.html">
        <img src="/img/logo/logoo1.png" alt="logo" class="logo"/>
      </a>
      
      <button class="navbar-toggler collapsed" type="button" data-toggle="collapse" data-target="#navbarSupportedContent1"
       aria-controls="navbarSupportedContent1 ">
       <i class="fas fa-bars iconav"></i></button>
        <ListItems/>
      </nav>
    )
  }
}
export default Navigation
